  @@feHeader = %q{
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
  } # 25.5 KB, hexdump via `od -A n -v -t x1 -w512`


  # Ruby shame
  def to_i(bool)
    bool == true ? 1 : 0
  end

end #class FPM::Package::Exe
